import React from "react";
import "../assets/Styles/RolesPage.css";

const RolesPage = () => {
  return (
    <div className="roles-page">
      <h1>Roles</h1>
      <p>Define, edit, and manage role permissions here.</p>
    </div>
  );
};

export default RolesPage;
